import { useState } from "react";

import PixelBanner from "../PixelBanner/PixelBanner";
import StandardWalk from "../StandardWalk/StandardWalk";
import PokeRadarWalk from "../PokeRadarWalk/PokeRadarWalk";
import SwarmWalk from "../SwarmWalk/SwarmWalk";

import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Box from "@mui/material/Box";

import "./Walk.scss";

function Walk({ standardWalkPokemon, swarmPokemon, radarPokemon }) {
  const swarmComponent = <SwarmWalk pokemon={swarmPokemon} />;
  const standardWalkComponent = <StandardWalk pokemon={standardWalkPokemon} />;
  const radarComponent = <PokeRadarWalk pokemon={radarPokemon} />;

  const [displayedTab, setDisplayedTab] = useState(standardWalkComponent);

  const handleTab = (e, displayTab) => {
    e.preventDefault();
    setDisplayedTab(displayTab);
  };

  return (
    <>
      <div className="walk-container">
        <PixelBanner banner="walk"></PixelBanner>
        <div className="method__banner">
          <div className="sprite__walk"></div>
          <div className="method__header method__header--walk">
            <h3 className="method__title">Walking</h3>
          </div>
          <div className="sprite__walk"></div>
        </div>
        <Box sx={{ width: "100%" }}>
          <Tabs
            value={standardWalkComponent}
            onChange={handleTab}
            textColor="secondary"
            indicatorColor="secondary"
            aria-label="secondary tabs example"
          >
            <Tab value={standardWalkComponent} label="Regular" />
            <Tab value={swarmComponent} label="Swarm" />
            <Tab value={radarComponent} label="PokeRadar" />
          </Tabs>
        </Box>
        {displayedTab}
        {/* <StandardWalk pokemon={standardWalkPokemon} /> */}
      </div>
    </>
  );
}

export default Walk;
